def getNPCID(puzzleID):

	key = str(puzzleID)

	cur.execute(""" SELECT npcID
					FROM npc_key
					WHERE npc_key.key = %s
					LIMIT 1
				""", key)

	for npcID in cur.fetchall():
		return str(npcID[0])
		
	return False

